import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
    <form>
      <label>Name : </label>
      <input type='text' ></input>
      <br/><br/>
      <label>Email : </label>
      <input type='emial'></input>
      <br/><br/>
      <label>Password : </label>
      <input type='password'></input>
      <br/><br/>
      <label>Confrom Password : </label>
      <input type='password'></input>
      <br/><br/>
      <input type='submit' value='Regiser'></input>
    </form>
    </div>
  );
}

export default App;
